function RequestFiltration(Airline, OrgCountry, DesCountry, Origin, Destination) {
    var Outputflag = false;
    try {
      
        var OrgDest = Origin + "-" + Destination;
        if (FilterDetails.length > 0) {
            var CurrAirDetails = $.grep(FilterDetails, function (j, k) {
                return j.AIRLINE == Airline
            });

            if (CurrAirDetails.length > 0) {

                CountryInculde = CurrAirDetails[0].value.CI; CountryExclude = CurrAirDetails[0].value.CE;
                SegmentInculde = CurrAirDetails[0].value.SECI; SegmentExclude = CurrAirDetails[0].value.SECE;
                AirportInculde = CurrAirDetails[0].value.AINC; AirportExclude = CurrAirDetails[0].value.AEXC;

                // Region finding Whether the airline is present or not
                if (((CountryInculde.length == 0 && CountryExclude.indexOf(OrgCountry) == -1 && CountryExclude.indexOf(DesCountry) == -1) || (CountryInculde.indexOf(OrgCountry) != -1 && CountryInculde.indexOf(DesCountry) != -1))
                    && ((CountryExclude.length == 0 && (CountryInculde.indexOf(OrgCountry) != -1 && CountryInculde.indexOf(DesCountry) != -1)) || (CountryExclude.indexOf(OrgCountry) == -1 && CountryExclude.indexOf(DesCountry) == -1))
                    && !ChkIncExcSegPresent(OrgDest, "E", "Airport") && ChkIncExcSegPresent(OrgDest, "I", "Airport") && !ChkIncExcSegPresent(OrgDest, "E", "Sector") && ChkIncExcSegPresent(OrgDest, "I", "Sector")) {
                    Outputflag = true;
                }
                else {
                    Outputflag = false;
                }
                //End region
            }
            else { // If Airline is not present in a given list
                Outputflag = true;
            }
        }
        else {
            Outputflag = true;
        }
        return Outputflag;
    }
    catch (e) {
        return true;
    }
}

function ChkIncExcSegPresent(segment, inclexclflag, AiptSectflag) { // segment = MAA-DEL, inclexclflag = I for Include, E for Exculde, AiptSectflag = Airport,Sector
    var segpresent = false;
    var SegExcIncary = [];
    if (AiptSectflag == "Airport")
        SegExcIncary = inclexclflag == "I" ? AirportInculde : AirportExclude;
    else
        SegExcIncary = inclexclflag == "I" ? SegmentInculde : SegmentExclude;

    if (SegExcIncary.length > 0) {
        if (AiptSectflag == "Airport") {
            if (inclexclflag == "I" && SegExcIncary.indexOf(segment.split("-")[0]) != -1 && SegExcIncary.indexOf(segment.split("-")[1]) != -1) {
                segpresent = true;
            }
            else if (inclexclflag == "E" && (SegExcIncary.indexOf(segment.split("-")[0]) != -1 || SegExcIncary.indexOf(segment.split("-")[1]) != -1)) {
                segpresent = true;
            }

        }
        else {
            if (SegExcIncary.indexOf(segment) != -1 || SegExcIncary.indexOf(segment.split("-")[1] + "-" + segment.split("-")[0]) != -1)
                segpresent = true;
        }
    }
    else if (inclexclflag == "I") {
        segpresent = true;
    }
    return segpresent;
}